import React from 'react'

const Blog = () => {
    return (
        <div className="gpt3__blog" id='blog'>
            <div className="gpt3__blog-heading">
                <h1 className="gradient__text">
                    A lot is happening we are blog about it.
                </h1>
            </div>
        </div>
    )
}

export default Blog
